import React, {
    Component
} from 'react';
import Card from 'react-bootstrap/Card';
import Button from 'react-bootstrap/Button';
import {
    Fragment
} from 'react';

import './flights.css';

class Flights extends Component {
    render() {

        let {
            flight
        } = this.props;
        return (

            <
            Fragment >
            <
            div className = "tile" >
            <
            Card style = {
                {
                    width: '18rem',
                    backgroundColor: 'lightgray'
                }
            } >
            <
            Card.Img variant = "top"
            src = {
                flight.links.mission_patch_small
            }
            /> <
            Card.Body >
            <
            Card.Title > {
                flight.mission_name
            } < /Card.Title> <
            Card.Text > {
                flight.details
            } <
            /Card.Text> <
            Button variant = "primary" > Go somewhere < /Button> <
            /Card.Body> <
            /Card></div >
            <
            /Fragment>

        )
    }
}

export default Flights;
